import React from "react";
// import { Link } from "react-router-dom";
export default function Header() {
  return (
    <ul>
      <li>
        <a href="/about">About</a>
        <a href="/feature">Feature</a>
        <a href="/installation">installation</a>
      </li>
    </ul>
  );
}
